INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "お！\nあそこに困ってそうな人発見！", 0, 1, 1.4, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, "春咲 ひより", 1001, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", "大切な人を\n守れるようになりたい…って", 0, 1, 1.4, "みんなみたいに\nわたしも強くならなきゃ", 0, "草野 優衣", 1002, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "少しは磨かれると思いますよ。", "キミに必要な集中力と感性が", 0, 1, 1.4, "フェンシングを始めてみては？", 0, "士条 怜", 1003, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "みそぎはねぇ、\nかくれんぼやりたい！", "今日はなにして遊ぶ？", 0, 1, 1.5, "ねぇ、にいちゃん！", 0, "穂高 みそぎ", 1004, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "私といっしょに…\nいかない？", "ねぇ…", 0, 1, 1.4, "風宮あかりです", 0, "風宮 あかり", 1006, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "食べ物の恨みは怖いのー", "プリンたべたいのー", 0, 1, 1.5, "出雲宮子なのー", 0, "出雲 宮子", 1007, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "いいよ。\n見られることは運命さ…", "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 1, 1.4, "ボクは虹村雪。", 0, "虹村 雪", 1008, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "人呼んで「疾風の冥姫」!!", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 1, 1.4, "フッ…聞いて後悔するがいい！", 0, "柊杏奈", 1009, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "ほんまおおきにやわ～♪", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 1, 1.5, "マホマホ王国のプリンセス、\nまほ姫どす", 0, "姫宮 真歩", 1010, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "ここで会ったが\n100年目～！", "生き別れたお兄ちゃんを探して\n三千世界！", 0, 1, 1.4, "衣之咲璃乃です！", 0, "衣之咲 璃乃", 1011, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "…って、お願い！\n誰にも言わないでおいて～！", "ち、超能力って…\n何のことかな～？", 0, 1, 1.4, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, "柏崎 初音", 1012, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "一応カリスマ読モJKやってまっす！", 0, 1, 1.4, "ちょす！\n美波鈴奈だよ～♪", 0, "美波 鈴奈", 1016, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "でも、沖縄もとってもいいとこさー", "東京は遊園地みたいなところさー", 0, 1, 1.4, "はいたーい。\n喜屋武香織さー。", 0, "喜屋武 香織", 1017, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "イオちゃんって呼んでね。", "先生って呼ばれるのは\nくすぐったいから", 0, 1, 1.4, "支倉伊緒です。", 0, "支倉 伊緒", 1018, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "ミミをおいてかないでぇ～", "あ！/\お兄ちゃ～ん\nまってよ～", 0, 1, 1.5, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, "茜 ミミ", 1020, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "ふぇぇぇぇぇん……", "あの……\nふぇ……", 0, 1, 1.5, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, "栗林 くるみ", 1021, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "なんてありがとうございます！", "こんな私に貴重な時間を\n割いていただき、", 0, 1, 1.4, "風宮よりです。\nあああああ！", 0, "風宮 より", 1022, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "私こっち行きたいー\nね、早く早くー", "おにいちゃんどこいくの？\nえ？", 0, 1, 1.5, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, "北条 綾音", 1023, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "これて何か違う…\nあああすみません！", "ふ、不束者ですが\nどうぞ末永く…って、", 0, 1, 1.4, "わっ…わっ…私、\n天野すずめといいます！", 0, "天野 すずめ", 1025, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "離しませんわ………\n絶対に…!!", "あなたは…運命の……\n伴侶……", 0, 1, 1.4, "……クスクス…私は\n…倉石恵理子……", 0, "倉石 恵理子", 1027, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "…そうでしょ？？", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 1, 1.4, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, "佐々木 咲恋", 1028, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "あはは、\n私もまだまだだなぁ～", "ぇっと…\nキミ、私のこと知らないの?!", 0, 1, 1.4, "桜井望だよ！\nよろしくねっ", 0, "桜井 望", 1029, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "ショーグン、\nワタシと一緒に天下統一デース！", "初めまして、\n私はニノン・ジュベール申すデス！", 0, 1, 1.4, "デケデケデンっ！", 0, "ニノン・ジュベール", 1030, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "おかしいですね……", "でもって私の隣にいるのが……\nえ、見えない？", 0, 1, 1.4, "上喜しのぶです。\n手元のドクロが父です。", 0, "上喜 しのぶ", 1031, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "そう、\nオラのボケに突っ込める相方が…！", "けんども\nそれには足りないモンが…", 0, 1, 1.5, "目指すはビッグな\nお笑い芸人だっぺ！", 0, "野戸まひる", 1033, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "ちょ\nちょっと一杯飲んできます…！", "ちょっと緊張しちゃって…", 0, 1, 1.4, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, "綾瀬 ゆかり", 1034, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "これ以上お話しすることは…\nないです！", "知らない人とは話しちゃいけないので", 0, 1, 1.5, "氷川鏡華…です", 0, "氷川 鏡華", 1036, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "……あ、アラーム。", 0, 1, 1.4, "柏崎…栞です。", 0, "柏崎 栞", 1038, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "野に咲く花が、\n唯一の話相手です。", "私、一人も友達がいなくて……", 0, 1, 1.4, "ふ、双葉碧です。", 0, "双葉 碧", 1040, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "そう思っています。", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 1, 1.4, "三角千歌です。", 0, "三角 千歌", 1042, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "う、疑ってすまなかったな…", "あぁ？\nお前のそいつの仲間か？", 0, 1, 1.4, "安芸真琴だ。", 0, "安芸 真琴", 1043, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "生けとし生ける全ての者よ！", 0, 1, 1.4, "わらわこそは夜を総べる者！", 0, "イリヤ・オーンスタイン", 1044, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "ｌク、クウカに何かご用ですか!?", "ぐふふふふ……はっ！", 0, 1, 1.4, "そこで騎士は妖精を乱暴に……", 0, "遠見 空花", 1045, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "う～ん…\n猫ってホントに最高にゃ～♪", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 1, 1.4, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, "宮坂たまき", 1046, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "それでは早速クエストに…", 0, 1, 1.4, "大神美冬よ！", 0, "大神 美冬", 1048, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "クエストもバトルも\n掃除も洗濯も", 0, 1, 1.4, "星野静流だよ！", 0, "星野静流", 1049, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "見ての通りの\nセクシー美少女で", 0, 1, 1.5, "アタシは玉泉美咲。", 0, "玉泉美咲", 1050, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "？？？？", "？？？？", 0, 1, 1.4, "？？？", 0, "リマ", 1052, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", 0, 1, 1.5, "モニカ・ヴァイスヴィントだ。", 0, "モニカ・ヴァイスヴィント", 1053, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", 0, 1, 1.5, "モニカ・ヴァイスヴィントだ。", 0, "ペコリーヌ", 1058, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", 0, 1, 1.5, "モニカ・ヴァイスヴィントだ。", 0, "コッコロ", 1059, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (2, 1, 1, 0, 0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", 0, 1, 1.5, "モニカ・ヴァイスヴィントだ。", 0, "キャル", 1060, 0);
